import React  from "react"
import "./table.css"


const Table = (props) => <div id={props.title}>
    <h1>          
        <i className={props.icon} />'
        {props.title} 
    </h1>
    <table>
        <tr>
            <th> # </th>
            {props.header.map(val => <th> {val} </th>)}
        </tr>
        {
            props.details.map((row, pos) => 
                <tr>
                    <td> {pos+1} </td>
                    {props.header.map(val => <td> {row[val]} </td>)}
                </tr>
            )
        }
    </table>
</div>

export default Table;
